import React from 'react';
import logo from './logo.svg';
import './App.css';
import Car from './Car/Car';



class Clock extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      cars: [{
        ovnerName: 'sosi',
        carLable: 'mazda',
        carEngine: true,
        carDriveMotion: true,
        carWheels: true
      }, {
        ovnerName: 'da',
        carLable: 'lada',
        carEngine: true,
        carDriveMotion: true,
        carWheels: true
      }, {
        ovnerName: 'net',
        carLable: 'honda',
        carEngine: false,
        carDriveMotion: false,
        carWheels: false
      }]
    };
  }

  render() {
    return (
      <div>
        <h1>Привет, мир!</h1>
        <div>
          {this.state.cars.map((car) => {





            return <Car 
            ovnerName={car.ovnerName}
            carLable={car.carLable}
            carEngine={car.carEngine}
            carDriveMotion={car.carDriveMotion}
            carWheels={car.carWheels} 
           />  





          })}
        </div>
      </div>
    );
  }
}








export default Clock;
